import React from 'react';
import steam from "../IMAGES/steam-icon-2026x2048-3b7rynay.png";
import contacto from "../IMAGES/asistencia.png";
import github from "../IMAGES/github-icon-2048x2048-eyd5tyuo.png";
import terminosImg from "../IMAGES/condicion.png";
import { Link } from 'react-router-dom';

const Footer = () => (
  <footer>
    <div className="new-section">
      <a href="https://store.steampowered.com/" className="footer-link" target="_blank" rel="noopener noreferrer">
        <img src={steam} alt="Steam Icon" /> Steam
      </a>
      <a href="#" className="footer-link">
        <img src={contacto} alt="Contacto Icon" /> Contacto
      </a>
      <a href="https://github.com/BautistaMoreno/PibardoSkins.io" className="footer-link" target="_blank" rel="noopener noreferrer">
        <img src={github} alt="GitHub Icon" /> GitHub
      </a>
      <Link to="/terminos" className="footer-link"> 
        <img src={terminosImg} alt="Términos Icon" /> Términos y condiciones
      </Link>
    </div>
    <div className="footer-container">
      <a href="#" className="footer-item">Blog</a>
      <a href="#" className="footer-item">Foros</a>
      <a href="https://html.spec.whatwg.org/" className="footer-item" target="_blank" rel="noopener noreferrer">Powered by HTML</a>
    </div>
    <p className="footer-rights">Derechos reservados a PibardoSkinsTecnolgi™</p>
  </footer>
);

export default Footer;
